import React from "react";
//import "./style.css";

function FruitsCard({clickHandler, id, image, name}) {
  return (
    <div className="card">
      <div className="img-container">
        <img alt={name} src={image} onClick={() => clickHandler(id)}/>
      </div>
      <div className="content">
        <ul>
          <li>
            <strong>Name:</strong> {name}
          </li>
        </ul>
      </div>
    </div>
  );
}

export default FruitsCard;
